import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate a specific product card and click it to open the details modal.
    // Using a combination of class and text content for a robust selector.
    const productCardLocator = page.locator('div.product-card:has-text("Sony WH-1000XM5")');
    await productCardLocator.waitFor({ state: 'visible', timeout: 5000 });
    await productCardLocator.click();

    // 2. Wait for the product detail modal to be visible.
    await page.waitForSelector('.modal[style*="display: block"] .product-detail-title', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Find and click the "Add to Wish List" button within the modal.
    // Using getByRole for better accessibility and resilience.
    const addToWishlistButton = page.getByRole('button', { name: 'Add to Wish List' });
    await addToWishlistButton.click();

    // 4. Wait for the success notification to appear.
    const notificationLocator = page.locator('.notification.success:has-text("Added to wishlist!")');
    await notificationLocator.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    // 5. Verify the action by checking localStorage.
    const wishlistData = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonWishlist'));
    });

    const addedItem = wishlistData.find(item => item.title.includes("Sony WH-1000XM5"));

    if (!addedItem) {
      throw new Error("Product was not found in the wishlist in localStorage.");
    }

    return {
      success: true,
      action: "Added 'Sony WH-1000XM5' product to the wishlist.",
      extractedData: {
        wishlistItem: addedItem,
        wishlistCount: wishlistData.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshotPath = path.join(screenshotsDir, 'error.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
